(500) Days of Summer (2009)  

Verenigde Staten
Komedie / Romantiek
95 minuten

geregisseerd door Marc Webb
met Zooey Deschanel, Joseph Gordon-Levitt en Matthew Gray Gubler

Tom kopieert wenskaarten voor zijn beroep en is een hopeloze romanticus. Hij is erg aangeslagen wanneer hij door zijn vriendin Summer aan de kant wordt gezet. Hij gaat heen en weer tussen verschillende periodes in de 500 dagen die ze samen waren om erachter te komen waar het fout is gegaan.

